import Head from 'next/head';
import Header from './Header';

const Layout = (props) =>{
    return (
        <div>
            <head>
                <title>  I am Here with woocommerce </title>
                <link rel="stylesheet" href="flatly/bootstrap.min.css"/>
            </head>
            <Header/>
            {props.children}
        </div>
    )
}

export default Layout;
